      providers: [
        { provide: DIALOG_DATA, useValue: this.config.data },
        { provide: DIALOG_CONFIG, useValue: this.config },
        { provide: DialogRef, useValue: this.dialogRef },
      ],
      parent: this.injector,
    });
  }
}

