  Component,
  ElementRef,
  EventEmitter,
  Input,
  OnInit,
  OnDestroy,
  ViewChild,
} from '@angular/core';
import {
  UntypedFormControl,
  UntypedFormGroup
} from '@angular/forms';
import {
  ClrDatagridFilter,
  ClrDatagridFilterInterface,
  ClrPopoverToggleService
} from '@clr/angular';
import {
  debounceTime,
  Subject,
  takeUntil
} from 'rxjs';

